import React from 'react';
import styles from './styles.module.scss';
import Button from '../../components/Button';

const buttons = [
  {
    name: 'Entry Free',
    color: '#15a13a',
    icon: '...'
  },
  {
    name: 'Track #1',
    color: '#bf9713',
    icon: '...'
  },
  {
    name: 'Track #2',
    color: '#bf8013',
    icon: '...'
  },
  {
    name: 'Track #3',
    color: '#bf6913',
    icon: '...'
  },
  {
    name: 'Track #4',
    color: '#bf3e13',
    icon: '...'
  }
];

const Race = () => {
  return (
    <div>
      <div>
            {buttons.map((button) => (
        <Button
          key={button.name}
          name={button.name}
          icon={button.icon}
          color={button.color}
        />
      ))}
      </div>
    </div>
  );
};

export default Race;
